import React from 'react'

// =============================
// COMPONENT CLASS
// =============================
class Header extends React.Component {
  render () {
    return (
      <header>
        <span>heard it through the</span>
        <h1>GRAPE<strong>VINE</strong></h1>
      </header>
    )
  }
}

// =============================
// EXPORT
// =============================
export default Header
